import { BrowserRouter } from "react-router-dom";
import "./Home.css";
import Links from "./Links";

function Header() {
  return (
    <BrowserRouter>
      <div id="header" className="header-footer">
        <Links />
      </div>
    </BrowserRouter>
  );
}

export default Header;
